function UserSignIn(){
    return (
        <>
        <div className="Sign In">
            <div className="sign-in-box">
                <form className="sign-in-form"></form>
                <input type="text" placeholder="Enter your username" className="sign-username"></input>
                <input type="password" placeholder="Enter your password" className="sign-pass"></input>
                <input type="password" placeholder="confirm password" className="sign-pass"></input>
            </div>
        </div>
        </>
    )
}

export default UserSignIn;
